import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function naruto(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/49031/b63a8c28-279c-4b39-bbef-c5401099da7f?autoplay=true" TituloAnime="Naruto " TituloCap="Episodio 1 – ¡Naruto Uzumaki ya está aquí!" DescAnime="Naruto es un joven aprendiz de ninja lleno de energía y bastante rebelde que no deja de hacer travesuras en su aldea, Konoha. No obstante, parece que guarda un gran secreto que ni él mismo conoce."/>
        </div>
    );
}

export default naruto;
